import React from 'react';
import Link from 'next/link';


const Index  = () => {
    
    return(
        <div>
            <h1>Fitness!</h1>
            <>
            <ul>
                <li>
                   <Link href="/workouts"> <a>Workouts</a> </Link>
                </li>
                <Link href="/about"><li>
                    <a>About us</a>
                </li>
                </Link>
            </ul>
            </>
        </div>
    )
}

export default Index;
